import React from 'react'
import App from '../App';
import '../style.css'

const AddAppliedJob = () => {
  return(
    <div className = "card text-white bg-warning mb-3" style = {{width:"100%"}}>
      <label className = "card-header">Enter Company Name: <input type = "text"></input></label>
      <h5 className = "card-title">Position</h5>
      <p className = "card-text">Description</p>
      <div>
        <button type="button" className="btn btn-success" style = {{margin: "5px", width: "30%"}}>Add job</button>
      </div>
    </div>
  );
}


export default AddAppliedJob
